/**
 * È¶ñÈ†ÅÂÖÉ‰ª∂ - ÁóáÁãÄË©ï‰º∞‰∏ª‰ªãÈù¢
 */

import React, { useCallback, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import toast from 'react-hot-toast';

import Header from '../components/Layout/Header';
import SymptomForm from '../components/SymptomForm/SymptomForm';
import TriageResult from '../components/TriageResult/TriageResult';
import HospitalList from '../components/HospitalList/HospitalList';

import { useGeolocation } from '../hooks/useGeolocation';
import {
  useSymptomQuery,
  useTriageResult,
  useHospitals,
  useLoadingState,
  useSymptomHistory,
  useLocation
} from '../stores/useAppStore';

import { triageApi, hospitalApi, emergencyApi, locationApi } from '../services/api';
import { TriageRequest, Hospital } from '../types';

const HomePage: React.FC = () => {
  const navigate = useNavigate();

  // ÁãÄÊÖãÁÆ°ÁêÜ
  const { currentQuery } = useSymptomQuery();
  const { latestResult, setLatestResult, clearLatestResult } = useTriageResult();
  const { nearbyHospitals, setNearbyHospitals, clearNearbyHospitals } = useHospitals();
  const { isLoading, error, setLoading, setError } = useLoadingState();
  const { addSymptomHistory } = useSymptomHistory();
  const { userLocation } = useLocation();

  // Âú∞ÁêÜ‰ΩçÁΩÆ
  const {
    getCurrentLocation,
    loading: locationLoading,
    error: locationError
  } = useGeolocation({
    onSuccess: (location) => {
      console.log('Location obtained:', location);
    },
    onError: (error) => {
      console.warn('Location error:', error);
    }
  });

  // ËôïÁêÜÁóáÁãÄË©ï‰º∞Êèê‰∫§
  const handleSymptomSubmit = useCallback(async (request: TriageRequest) => {
    setLoading(true);
    setError(null);
    clearLatestResult();
    clearNearbyHospitals();

    try {
      // Â¶ÇÊûúÈúÄË¶Å‰ΩçÁΩÆË≥áË®ä‰ΩÜÂ∞öÊú™ÂèñÂæóÔºåÂÖàÂòóË©¶ÂèñÂæó‰ΩçÁΩÆ
      if (request.include_nearby_hospitals && !request.location && userLocation) {
        request.location = userLocation;
      }

      // Âü∑Ë°åÁóáÁãÄË©ï‰º∞
      const result = await triageApi.quickTriage(request);
      setLatestResult(result);

      // Âä†ÂÖ•Ê≠∑Âè≤Ë®òÈåÑ
      addSymptomHistory({
        symptom_text: request.symptom_text,
        triage_level: result.triage_level,
        timestamp: new Date().toISOString(),
        location: request.location
      });

      // Â¶ÇÊûúÊúâÈôÑËøëÈÜ´Èô¢Ë≥áÊñôÔºåÁõ¥Êé•Ë®≠ÂÆö
      if (result.nearby_hospitals) {
        setNearbyHospitals(result.nearby_hospitals);
      }

      // ÊàêÂäüÊèêÁ§∫
      toast.success('ÁóáÁãÄË©ï‰º∞ÂÆåÊàê');

      // Â¶ÇÊûúÊòØÁ∑äÊÄ•ÊÉÖÊ≥ÅÔºåÈ°ØÁ§∫ÁâπÂà•ÊèêÈÜí
      if (result.triage_level === 'emergency') {
        toast.error('Ê™¢Ê∏¨Âà∞Á∑äÊÄ•ÁãÄÊ≥ÅÔºÅË´ãÁ´ãÂç≥Êí•Êâì119', {
          duration: 10000,
          position: 'top-center'
        });
      }

    } catch (err) {
      const message = err instanceof Error ? err.message : 'Ë©ï‰º∞Â§±ÊïóÔºåË´ãÈáçË©¶';
      setError(message);
      toast.error(message);
      console.error('Triage submission error:', err);
    } finally {
      setLoading(false);
    }
  }, [
    setLoading,
    setError,
    clearLatestResult,
    clearNearbyHospitals,
    setLatestResult,
    addSymptomHistory,
    setNearbyHospitals,
    userLocation
  ]);

  // ËôïÁêÜÂ∞ãÊâæÈôÑËøëÈÜ´Èô¢
  const handleFindHospitals = useCallback(async () => {
    if (!userLocation) {
      toast.error('Ë´ãÂÖàÂÖÅË®±‰ΩçÁΩÆÂ≠òÂèñ');
      return;
    }

    setLoading(true);
    try {
      const hospitals = await hospitalApi.searchNearby({
        latitude: userLocation.latitude,
        longitude: userLocation.longitude,
        radius: 10000, // 10km
        limit: 20,
        departments: latestResult?.recommended_departments
      });

      // Ë®àÁÆóË∑ùÈõ¢‰∏¶ÊéíÂ∫è
      const hospitalsWithDistance = hospitals.map(hospital => ({
        ...hospital,
        distance: locationApi.calculateDistance(
          userLocation.latitude,
          userLocation.longitude,
          hospital.lat,
          hospital.lng
        )
      })).sort((a, b) => a.distance - b.distance);

      setNearbyHospitals(hospitalsWithDistance);
      toast.success(`ÊâæÂà∞ ${hospitals.length} ÂÆ∂ÈôÑËøëÈÜ´Èô¢`);

    } catch (err) {
      const message = err instanceof Error ? err.message : 'ÊêúÂ∞ãÈÜ´Èô¢Â§±Êïó';
      toast.error(message);
      console.error('Hospital search error:', err);
    } finally {
      setLoading(false);
    }
  }, [userLocation, latestResult?.recommended_departments, setLoading, setNearbyHospitals]);

  // ËôïÁêÜÁ∑äÊÄ•Êí•Ëôü
  const handleEmergencyCall = useCallback((number: string) => {
    emergencyApi.call(number);

    // Ë®òÈåÑÁ∑äÊÄ•Êí•Ëôü‰∫ã‰ª∂
    console.log(`Emergency call initiated: ${number}`);
    toast.success(`Ê≠£Âú®Êí•Êâì ${number}`, {
      icon: 'üìû'
    });
  }, []);

  // ËôïÁêÜÈÜ´Èô¢ÈÅ∏Êìá
  const handleHospitalSelect = useCallback((hospital: Hospital) => {
    console.log('Hospital selected:', hospital);
    toast.success(`Â∑≤ÈÅ∏ÊìáÔºö${hospital.name}`);
  }, []);

  // ËôïÁêÜÈÜ´Èô¢ÈõªË©±Êí•Êâì
  const handleHospitalCall = useCallback((phone: string) => {
    emergencyApi.call(phone);
    toast.success(`Ê≠£Âú®Êí•ÊâìÔºö${phone}`, {
      icon: 'üìû'
    });
  }, []);

  // ËôïÁêÜÈÜ´Èô¢Â∞éËà™
  const handleHospitalNavigate = useCallback((hospital: Hospital) => {
    const googleMapsUrl = `https://www.google.com/maps/dir/?api=1&destination=${hospital.lat},${hospital.lng}&destination_place_id=${hospital.id}`;

    try {
      window.open(googleMapsUrl, '_blank');
      toast.success(`Ê≠£Âú®ÈñãÂïüÂ∞éËà™Ëá≥Ôºö${hospital.name}`);
    } catch (err) {
      // Â¶ÇÊûúÁÑ°Ê≥ïÈñãÂïüÔºåË§áË£ΩÂú∞ÂùÄÂà∞Ââ™Ë≤ºÁ∞ø
      navigator.clipboard?.writeText(hospital.address);
      toast.success(`Âú∞ÂùÄÂ∑≤Ë§áË£ΩÔºö${hospital.address}`);
    }
  }, []);

  // ËôïÁêÜ‰ΩçÁΩÆÈªûÊìä
  const handleLocationClick = useCallback(() => {
    if (locationLoading) return;
    getCurrentLocation();
  }, [getCurrentLocation, locationLoading]);

  // ËôïÁêÜÊ≠∑Âè≤Ë®òÈåÑÈªûÊìä
  const handleHistoryClick = useCallback(() => {
    navigate('/history');
  }, [navigate]);

  // Ëá™ÂãïÂèñÂæó‰ΩçÁΩÆÔºàÈ¶ñÊ¨°ËºâÂÖ•Ôºâ
  useEffect(() => {
    if (!userLocation && !locationError) {
      // Âª∂ÈÅ≤‰∏Ä‰∏ãÂÜçËá™ÂãïÂèñÂæó‰ΩçÁΩÆÔºåÈÅøÂÖçÂπ≤Êìæ‰ΩøÁî®ËÄÖ
      const timer = setTimeout(() => {
        getCurrentLocation();
      }, 1000);

      return () => clearTimeout(timer);
    }
  }, [userLocation, locationError, getCurrentLocation]);

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Ê®ôÈ°åÂàó */}
      <Header
        onLocationClick={handleLocationClick}
        onHistoryClick={handleHistoryClick}
      />

      {/* ‰∏ªË¶ÅÂÖßÂÆπ */}
      <main className="container-responsive py-6 space-y-6">
        {/* ÈåØË™§Ë®äÊÅØ */}
        {error && (
